import { Box, withStyles } from "@material-ui/core";

interface IProps {
  quizId: number;
}

export default function QuizTestPage({ quizId }: IProps) {
  return <Container>{quizId}</Container>;
}

const Container = withStyles({
  root: {
    display: "flex",
    width: "100vw",
    minHeight: "calc(100vh - 100px)",
    flexDirection: "column",
    alignItems: "center",
    padding: "2rem 1rem",
    backgroundColor: "#f0f2f5",
  },
})(Box);
